import React from "react";
import ReactDOM from 'react-dom';
import './res/styles/main.css';
import {Content} from "./components/content";
import PopupHandler from "./components/popup-handler";
import {DrawBox} from "./components/drawbox/draw-box";
import {Type} from "./components/drawbox/extended/type";
import {DrawBoxComponent} from "./contents/git/git-components";
import {Path} from "./components/drawbox/simple/path";

function getMainContent() {
    return <><Content/><PopupHandler/></>;
}

function getScript() {
    let t1 = new Type()
        .setPosition([200,200])
        .setWidth(100)
        .setType('interface')
        .setLabel("Runnable")

    let t2 = new Type()
        .setPosition([200,230])
        .setWidth(100)
        .setType('class')
        .setLabel("Main")

    let t3 = new Type()
        .setPosition([200,260])
        .setWidth(100)
        .setType('annotation')
        .setLabel("Configurer")

    let p1=new Path()
        .setStart([100,100])
        .lineTo([150,130])
        .lineTo(['40d',100])
        .lineTo([t3,0])

    let db = new DrawBox()
        .addShape(t1)
        .addShape(t2)
        .addShape(t3)
        .addShape(p1)

    return (
        <DrawBoxComponent wh={[500, 500]} shapeFactory={db}/>
    )
}

// ReactDOM.render(getMainContent(), document.querySelector('#root'));
ReactDOM.render(getScript(), document.querySelector('#root'));
